      out.write("\t\t\r\n");
      out.write("\t\t// if(!triggerName){mini.alert(\"调度名称不能为空\");return;}\r\n");
      out.write("\t\tif(!description){mini.alert(\"调度描述不能为空\");return;}\r\n");
